import http from "../http-common"

class StudentsDataService{

    deleteByEmail(email)
    {
        return http.delete('http://localhost:3080/students/'+email)
    }

    getByName(fname, lname)
    {
        return http.get('http://localhost:3080/students/'+fname + "/" + lname)
    }

    getAll(){
        return http.get("http://localhost:3080/students")
    }
    getById(Id){
        return http.get('http://localhost:3080/students/' + Id)
    }

    update(email, data){
        return http.put('http://localhost:3080/students' + email, data)
    }

    create(){
        return http.post("http://localhost:3080/add-student", JSON.stringify({
            fname: "as",
            lname: "asgasg",
            username: "asg",
            password: "sag",
            email: "sagasg"
        }))
    }
}

export default new StudentsDataService
